input = ""


def find_marker(s: str = input, marker_size: int = 4) -> int:
    for i in range(len(s) - marker_size):
        if len(set(s[i:i + marker_size])) == marker_size:
            return i + marker_size
    return -1


print("Solution 1:", find_marker())
print("Solution 2:", find_marker(marker_size=14))
